import React, { useState } from 'react';

import Modal from '../../aux/Modal';
import ArrangementDialog from '../../Dialog/components/ArrangementDialog/ArrangementDialog';

import './styles.scss';

export default function CheckoutCartElement(el) {
    const [dialog, setDialog] = useState(false);

    return(
        <>
        <div className="checkout-cart-el">
            <div className="checkout-cart-el__content">
                <img className="element-img" 
                    src={el.picture} alt="planta" />
                <h3 className="element-title">{el.name}</h3>
            </div>
        </div>
            {
            dialog &&
                <Modal>
                    <ArrangementDialog handler={() => setDialog(false)}/>
                </Modal>
            }
        </>
    );
}
